    /**
     * 暴力法
     * 两层循环，内层控制当前匹配字符串后依次取出包含当前子字符串的字符串，外层循环控制最小字符串，导致多次无用循环
     * minLenPositions记录当前位置前多少个字符是包含当前子字符串的字符串。
     *
     * 动态变化初始位置 减少非必要循环
     * @param s 目标字符串
     * @param t 子字符串
     * @return 返回目标字符串包含子字符串的最小字符串
     */
    public String minSubStrOpt(String s, String t){
        long startTime = System.currentTimeMillis();
        String result = "";
        char[] cs = s.toCharArray();
        char[] ct = t.toCharArray();
        int[] minLenPositions = new int[s.length()];
        outLop:for (int x = 0; x <= s.length() - t.length(); x++) {
            int tp = 0;
            int[] estates = new int[t.length()];
            int changeCount = 0;
            int firstMatch = 0;
            int minPosition = 0;
            int maxPosition = 0;
            //int nextPosition = -1;
            innerLop : for (int i = x; i <= s.length() - t.length() + tp; i++) {
                char csi = cs[i];
                //每遍历一个字符串和要找的字符串对比
                for (int j = 0; j < t.length(); j++) {
                    char ctj = ct[j];
                    if (csi == ctj){
                        if (firstMatch == 1){
                            //nextPosition = i;
                            firstMatch = 2;
                        }
                        if(estates[j] == 0){
                            estates[j] = 1;
                            changeCount ++;
                            if (firstMatch == 0){
                                firstMatch = 1;
                                minPosition = i;
                            }
                            tp ++;
                            break ;
                        }
                    }
                }
                if(changeCount == t.length()){
                    maxPosition = i;
                    minLenPositions[minPosition] = maxPosition - minPosition + 1;
                    continue outLop;
                }
                if(maxPosition - minPosition == t.length()){
                    break outLop;
                }
            }
        }
        int minLen = -1;
        int minLenPosition = -1;
        for (int i = 0; i < minLenPositions.length; i++) {
            if(minLenPositions[i] > 0 && minLen < 0){
                minLen = minLenPositions[i];
                minLenPosition = i;
            }
            if(minLenPositions[i] > 0 && minLenPositions[i] < minLen){
                minLen = minLenPositions[i];
                minLenPosition = i;
            }
        }
        if(minLen > 0){
            result = new String(cs,minLenPosition, minLen);
        }
        System.out.println("minSubStrOpt cost time===" + (System.currentTimeMillis() - startTime));
        return result;
    }

    public String minSubStr(String s, String t) {
        long startTime = System.currentTimeMillis();
        String result = "";
        char[] cs = s.toCharArray();
        char[] ct = t.toCharArray();
        int[] minLenPositions = new int[s.length()];
        outLop:for (int x = 0; x <= s.length() - t.length(); x++) {
            int tp = 0;
            int[] estates = new int[t.length()];
            int changeCount = 0;
            boolean firstMatch = false;
            int minPosition = 0;
            int maxPosition = 0;
            innerLop : for (int i = x; i <= s.length() - t.length() + tp; i++) {
                char csi = cs[i];
                for (int j = 0; j < t.length(); j++) {
                    char ctj = ct[j];
                    if (csi == ctj && estates[j] == 0){
                        estates[j] = 1;
                        changeCount ++;
                        if (!firstMatch){
                            firstMatch = true;
                            minPosition = i;
                        }
                        tp ++;
                        break ;
                    }
                }
                if(changeCount == t.length()){
                    maxPosition = i;
                    minLenPositions[minPosition] = maxPosition - minPosition + 1;
                    continue outLop;
                }
                if(maxPosition - minPosition == t.length()){
                    break outLop;
                }
            }
        }
        int minLen = -1;
        int minLenPosition = -1;
        for (int i = 0; i < minLenPositions.length; i++) {
            if(minLenPositions[i] > 0 && minLen < 0){
                minLen = minLenPositions[i];
                minLenPosition = i;
            }
            if(minLenPositions[i] > 0 && minLenPositions[i] < minLen){
                minLen = minLenPositions[i];
                minLenPosition = i;
            }
        }
        if(minLen > 0){
            result = new String(cs,minLenPosition, minLen);
        }
        System.out.println("minSubStr cost time===" + (System.currentTimeMillis() - startTime));
        return result;
    }

    public String minWindow(String s, String t) {
        long startTime = System.currentTimeMillis();
        if (s == null || s.length() == 0) {
            return "";
        }

        int left = 0;
        int right = 0;
        Map<Character, Integer> map2 = new HashMap<>();
        for (int i = 0; i < t.length(); i++) {
            for (char c : t.toCharArray()) {
                map2.put(c, map2.getOrDefault(c, 0).intValue() + 1);
            }
        }
        Map<Integer, String> map = new HashMap<>();
        int result = Integer.MAX_VALUE;
        while (left <= right && right < s.length()) {
            String sub = s.substring(left, right + 1);
            if (conclude(sub, t)) {
                int value = right - left + 1;
                map.put(value, sub);
                result = Math.min(result, value);
                left++;
            } else {
                right++;
            }
        }
        System.out.println("minWindow cost time===" + (System.currentTimeMillis() - startTime));
        return map.getOrDefault(result, "");

    }

    public boolean conclude(String s1, String s2) {
        if (s1.length() < s2.length()) {
            return false;
        }
        Map<Character, Integer> map1 = new HashMap<>();
        Map<Character, Integer> map2 = new HashMap<>();
        for (char c : s1.toCharArray()) {
            map1.put(c, map1.getOrDefault(c, 0).intValue() + 1);
        }
        for (char c : s2.toCharArray()) {
            map2.put(c, map2.getOrDefault(c, 0).intValue() + 1);
        }
        for (char c : map2.keySet()) {
            if (map1.getOrDefault(c, 0).intValue() < map2.getOrDefault(c, 0).intValue()) {
                return false;
            }
        }
        return true;
    }

    /**
     * 滑动窗口
     *  a~z [97~122]
     * [91~96] 6个字符我们暂时不关心
     * A~Z [65~90]
     * 1~9 [48~57]
     * 2. 可以开辟一个大小为64的数组，来存放数组中字母的频率(Frequency)。准确的说，
     *    通过字母的ASCII码作为数组的索引，开辟空间的大小为26+6+26=58：26个大写字母，26个小写字母，
     *    还有中间的6个非字母  A~Z[65~90]  非字母[91~96]  a~z[97~122]
     * 3. 滑动窗口的使用：分三种情况来移动窗口：（这里令当前窗口的左右边界分别为l，r，窗口的大小为winSize=r-l+1）
     *    1) 当winSize < t.size()  r++;  也就是窗口右边界向右移动
     *    2) 当winSize == t.size() :
     * 	   2.1) 当窗口中的字符已经符合要求了，直接返回return，已经找到了
     * 	   2.2) 否则r++，窗口右边界向右移动
     *    3) 当winSize > t.size()
     * 	   2.1) 当窗口中的字符已经符合要求了，l++，窗口左边界向右移动
     * 	   2.2) 否则r++，窗口右边界向右移动
     * @param s
     * @param t
     * @return
     */
    public String minSubStrSlide(String s, String t){
        int left = 0;
        int right = t.length() - 1;
        int[] subStrCounts = new int[64];
        for (int i = 0; i < t.length(); i++) {
            subStrCounts[t.charAt(i) - 'A'] ++;
        }
        int minLen = Integer.MAX_VALUE;
        int minPosition = -1;
        while (left <= s.length() - t.length()){
            int subMatchLen = right - left + 1;
            if(subMatchLen < t.length() ){
                if(right < s.length() - 1) {
                    right++;
                }
                continue;
            }else{
                String subMatchStr = s.substring(left, right + 1);
                boolean isMatch = true;
                int[] subMatchStrCounts = new int[64];
                for (int i = 0; i < subMatchStr.length(); i++) {
                    subMatchStrCounts[subMatchStr.charAt(i) - 'A'] ++;
                }
                for (int i = 0; i < t.length(); i++) {
                    int subStrCount = subStrCounts[t.charAt(i) - 'A'];
                    int subMatchStrCount = subMatchStrCounts[t.charAt(i) - 'A'];
                    if(subMatchStrCount < subStrCount){
                        isMatch = false;
                        break;
                    }
                }
                if(!isMatch){
                    if(right == s.length() - 1) {
                        break;
                    }
                    if(right < s.length() - 1) {
                        right++;
                    }
                    continue;
                }
                if(minLen > subMatchLen){
                    minLen = subMatchLen;
                    minPosition = left;
                }
                if (minLen == t.length()){
                    break;
                }else{
                    left ++;
                }
            }
        }
        String result = "";
        if(minLen < Integer.MAX_VALUE) {
            result = s.substring(minPosition, minPosition + minLen);
        }
        return result;
    }

    /**
     * 优化上一滑动窗口算法 遍历子字符串改遍历子字符串的出现频率数组
     * @param s
     * @param t
     * @return
     */
    public String minSubStrSlideOpt(String s, String t){
        int left = 0;
        int right = 0;
        //要找的字符串出现频率次
        int[] subStrCounts = new int[64];
        for (int i = 0; i < t.length(); i++) {
            subStrCounts[t.charAt(i) - 'A'] ++;
        }
        int minLen = Integer.MAX_VALUE;
        int minPosition = -1;
        int[] ostrCounts = new int[64];
        //ADOBECODEBANC
        while (left <= s.length() - t.length()){
            int subMatchLen = right - left;
            if(subMatchLen < t.length() ){
                if(right < s.length()) {
                    ostrCounts[s.charAt(right++) - 'A'] ++;
                }
                continue;
            }else{
                boolean isMatch = true;
                for (int i = 0; i < 64; i++) {
                    if(ostrCounts[i] < subStrCounts[i]){
                        isMatch = false;
                        break;
                    }
                }
                if(!isMatch){
                    if(right == s.length()) {
                        break;
                    }
                    ostrCounts[s.charAt(right ++) - 'A'] ++;
                    continue;
                }
                if(minLen > subMatchLen){
                    minLen = subMatchLen;
                    minPosition = left;
                }
                if (minLen == t.length()){
                    break;
                }else{
                    ostrCounts[s.charAt(left ++) - 'A'] --;
                }
            }
        }
        String result = "";
        if(minLen < Integer.MAX_VALUE) {
            result = s.substring(minPosition, minPosition + minLen);
        }
        return result;
    }

    public String bestMinSubStrSlide(String s, String t){
        if (s.length() < t.length()) return "";

        int sFreq[] = new int[64], tFreq[] = new int[64];  // frequency数组
        for (int i = 0; i < t.length(); i++) tFreq[t.charAt(i) - 'A']++;

        int l = 0, r = -1;
        int[] edge = { -1, s.length() + 1};  //edge数组表示要求的串的左右边界
        while (l <= s.length() - t.length()) {

            // < t.size()  直接窗口右边界右移，循环continue
            if (r - l + 1 < t.length()) {
                if (r + 1 < s.length()) {      // 这里注意到数组越界
                    sFreq[s.charAt(++r) - 'A']++; continue;
                }
                else break;
            }
            // >= t.size() 先判断当前窗口中的字符是否满足“题目要求”
            int i = 0;
            while (i < 64) {
                if (sFreq[i] < tFreq[i]) break;
                i++;
            }
            if (i < 64) {
                // 这里注意到数组越界
                if (r + 1 < s.length()) sFreq[s.charAt(++r) - 'A']++;
                else sFreq[s.charAt(l++) - 'A']--;
            }else {
                if (r - l + 1 == t.length()) return s.substring(l, r + 1);
                else {
                    if (r - l < edge[1] - edge[0]) {
                        edge[0] = l;
                        edge[1] = r;
                    }
                    sFreq[s.charAt(l++) - 'A']--;
                }
            }
        }
        return edge[0] == -1 ? "" : s.substring(edge[0], edge[1] + 1);
    }

    public String minWindowOpt(String s, String t) {
        int tLen = t.length();
        for (int i = 0; i < tLen; i++) {
            char c = t.charAt(i);
            ori.put(c, ori.getOrDefault(c, 0) + 1);
        }
        int l = 0, r = -1;
        int len = Integer.MAX_VALUE, ansL = -1, ansR = -1;
        int sLen = s.length();
        while (r < sLen) {
            ++r;
            if (r < sLen && ori.containsKey(s.charAt(r))) {
                cnt.put(s.charAt(r), cnt.getOrDefault(s.charAt(r), 0) + 1);
            }
            while (check() && l <= r) {
                if (r - l + 1 < len) {
                    len = r - l + 1;
                    ansL = l;
                    ansR = l + len;
                }
                if (ori.containsKey(s.charAt(l))) {
                    cnt.put(s.charAt(l), cnt.getOrDefault(s.charAt(l), 0) - 1);
                }
                ++l;
            }
        }
        return ansL == -1 ? "" : s.substring(ansL, ansR);
    }

    public boolean check() {
        Iterator iter = ori.entrySet().iterator();
        while (iter.hasNext()) {
            Map.Entry entry = (Map.Entry) iter.next();
            Character key = (Character) entry.getKey();
            Integer val = (Integer) entry.getValue();
            if (cnt.getOrDefault(key, 0) < val) {
                return false;
            }
        }
        return true;
    }
